export default function Question({ QUESTION ,chooseA, chooseB, chooseC, chooseD}) {
  return QUESTION.map((question) => (
    <div>
      <h3>
        Question {questionNumber}: {question.question1}
      </h3>
      <ol>
        <li className="answer" value="1" onClick={chooseA}>
          {question.answer1}
        </li>
        <li className="answer" onClick={chooseB}>
          {question.answer2}
        </li>
        <li className="answer" onClick={chooseC}>
          {question.answer3}
        </li>
        <li className="answer" onClick={chooseD}>
          {question.answer4}
        </li>
      </ol>
    </div>
  ));
}
